(window.webpackJsonp=window.webpackJsonp||[]).push([[11],{213:function(n){n.exports={data:{blogPost:{title:"Third post",date:"May 7, 2019",content:'<p>Markdown manual</p>\n<h3 id="1-斜体和粗体"><a href="#1-%E6%96%9C%E4%BD%93%E5%92%8C%E7%B2%97%E4%BD%93" aria-hidden="true"><span class="icon icon-link"></span></a>1. 斜体和粗体</h3>\n<p>使用 * 和 ** 表示斜体和粗体。</p>\n<p>示例：</p>\n<p>这是 <em>斜体</em>，这是 <strong>粗体</strong>。</p>\n<h3 id="2-分级标题"><a href="#2-%E5%88%86%E7%BA%A7%E6%A0%87%E9%A2%98" aria-hidden="true"><span class="icon icon-link"></span></a>2. 分级标题</h3>\n<p>使用 === 表示一级标题，使用 --- 表示二级标题。</p>\n<p>示例：</p>\n<pre><code>这是一个一级标题\n============================\n\n这是一个二级标题\n--------------------------------------------------\n\n### 这是一个三级标题\n</code></pre>\n<p>你也可以选择在行首加井号表示不同级别的标题 (H1-H6)，例如：# H1, ## H2, ### H3，#### H4。</p>\n<h3 id="3-外链接"><a href="#3-%E5%A4%96%E9%93%BE%E6%8E%A5" aria-hidden="true"><span class="icon icon-link"></span></a>3. 外链接</h3>\n<p>使用 [描述](链接地址) 为文字增加外链接。</p>\n<p>示例：</p>\n<p>这是去往 <a href="http://github.com/songroger" target="_blank" rel="nofollow noopener noreferrer">本人博客</a> 的链接。</p>\n<h3 id="4-无序列表"><a href="#4-%E6%97%A0%E5%BA%8F%E5%88%97%E8%A1%A8" aria-hidden="true"><span class="icon icon-link"></span></a>4. 无序列表</h3>\n<p>使用 *，+，- 表示无序列表。</p>\n<p>示例：</p>\n<ul>\n<li>无序列表项 一</li>\n<li>无序列表项 二</li>\n<li>无序列表项 三</li>\n</ul>\n<h3 id="5-有序列表"><a href="#5-%E6%9C%89%E5%BA%8F%E5%88%97%E8%A1%A8" aria-hidden="true"><span class="icon icon-link"></span></a>5. 有序列表</h3>\n<p>使用数字和点表示有序列表。</p>\n<p>示例：</p>\n<ol>\n<li>有序列表项 一</li>\n<li>有序列表项 二</li>\n<li>有序列表项 三</li>\n</ol>\n<h3 id="6-文字引用"><a href="#6-%E6%96%87%E5%AD%97%E5%BC%95%E7%94%A8" aria-hidden="true"><span class="icon icon-link"></span></a>6. 文字引用</h3>\n<p>使用 > 表示文字引用。</p>\n<p>示例：</p>\n<blockquote>\n<p>野火烧不尽，春风吹又生。</p>\n</blockquote>\n<h3 id="7-行内代码块"><a href="#7-%E8%A1%8C%E5%86%85%E4%BB%A3%E7%A0%81%E5%9D%97" aria-hidden="true"><span class="icon icon-link"></span></a>7. 行内代码块</h3>\n<p>使用 `代码` 表示行内代码块。</p>\n<p>示例：</p>\n<p>让我们聊聊 <code>html</code>。</p>\n<h3 id="8--代码块"><a href="#8--%E4%BB%A3%E7%A0%81%E5%9D%97" aria-hidden="true"><span class="icon icon-link"></span></a>8.  代码块</h3>\n<p>使用 四个缩进空格 表示代码块。</p>\n<p>示例：</p>\n<pre><code>这是一个代码块，此行左侧有四个不可见的空格。\n</code></pre>\n<h3 id="9--插入图像"><a href="#9--%E6%8F%92%E5%85%A5%E5%9B%BE%E5%83%8F" aria-hidden="true"><span class="icon icon-link"></span></a>9.  插入图像</h3>\n<p>使用 ![描述](图片链接地址) 插入图像。</p>\n<p>示例：</p>\n<p><img src="https://www.zybuluo.com/static/img/my_head.jpg" alt="我的头像"></p>\n<h2 id="markdown-高阶语法手册"><a href="#markdown-%E9%AB%98%E9%98%B6%E8%AF%AD%E6%B3%95%E6%89%8B%E5%86%8C" aria-hidden="true"><span class="icon icon-link"></span></a>Markdown 高阶语法手册</h2>\n<h3 id="1-标签分类"><a href="#1-%E6%A0%87%E7%AD%BE%E5%88%86%E7%B1%BB" aria-hidden="true"><span class="icon icon-link"></span></a>1. 标签分类</h3>\n<p>在编辑区任意行的列首位置输入以下代码给文稿标签：</p>\n<p>标签： 数学 英语 Markdown</p>\n<p>或者</p>\n<p>Tags： 数学 英语 Markdown</p>\n<h3 id="2-删除线"><a href="#2-%E5%88%A0%E9%99%A4%E7%BA%BF" aria-hidden="true"><span class="icon icon-link"></span></a>2. 删除线</h3>\n<p>使用 ~~ 表示删除线。</p>\n<p><del>这是一段错误的文本。</del></p>\n<h3 id="3-注脚"><a href="#3-%E6%B3%A8%E8%84%9A" aria-hidden="true"><span class="icon icon-link"></span></a>3. 注脚</h3>\n<p>使用 [^keyword] 表示注脚。</p>\n<p>这是一个注脚[^footnote]的样例。</p>\n<p>这是第二个注脚[^footnote2]的样例。</p>\n<h3 id="4-加强的代码块"><a href="#4-%E5%8A%A0%E5%BC%BA%E7%9A%84%E4%BB%A3%E7%A0%81%E5%9D%97" aria-hidden="true"><span class="icon icon-link"></span></a>4. 加强的代码块</h3>\n<p>支持四十一种编程语言的语法高亮的显示，行号显示。</p>\n<p>非代码示例：</p>\n<pre><code>$ sudo apt-get install vim-gnome\n</code></pre>\n<p>Python 示例：</p>\n<pre><code class="language-python">@requires_authorization\ndef somefunc(param1=\'\', param2=0):\n    \'\'\'A docstring\'\'\'\n    if param1 > param2: # interesting\n        print \'Greater\'\n    return (param2 - param1 + 1) or None\n\nclass SomeClass:\n    pass\n\n>>> message = \'\'\'interpreter\n... prompt\'\'\'\n</code></pre>\n<p>JavaScript 示例：</p>\n<pre><code class="language-javascript">/**\n* nth element in the fibonacci series.\n* @param n >= 0\n* @return the nth element, >= 0.\n*/\nfunction fib(n) {\n  var a = 1, b = 1;\n  var tmp;\n  while (--n >= 0) {\n    tmp = a;\n    a += b;\n    b = tmp;\n  }\n  return a;\n}\n\ndocument.write(fib(10));\n</code></pre>\n<h3 id="5-定义型列表"><a href="#5-%E5%AE%9A%E4%B9%89%E5%9E%8B%E5%88%97%E8%A1%A8" aria-hidden="true"><span class="icon icon-link"></span></a>5. 定义型列表</h3>\n<p>名词 1\n:   定义 1（左侧有一个可见的冒号和四个不可见的空格）</p>\n<p>代码块 2\n:   这是代码块的定义（左侧有一个可见的冒号和四个不可见的空格）</p>\n<pre><code>    代码块（左侧有八个不可见的空格）\n</code></pre>\n<h3 id="6-html-标签"><a href="#6-html-%E6%A0%87%E7%AD%BE" aria-hidden="true"><span class="icon icon-link"></span></a>6. Html 标签</h3>\n<p>本站支持在 Markdown 语法中嵌套 Html 标签，譬如，你可以用 Html 写一个纵跨两行的表格：</p>\n<pre><code>&#x3C;table>\n    &#x3C;tr>\n        &#x3C;th rowspan="2">值班人员&#x3C;/th>\n        &#x3C;th>星期一&#x3C;/th>\n        &#x3C;th>星期二&#x3C;/th>\n        &#x3C;th>星期三&#x3C;/th>\n    &#x3C;/tr>\n    &#x3C;tr>\n        &#x3C;td>李强&#x3C;/td>\n        &#x3C;td>张明&#x3C;/td>\n        &#x3C;td>王平&#x3C;/td>\n    &#x3C;/tr>\n&#x3C;/table>\n</code></pre>\n<table>\n    <tr>\n        <th rowspan="2">值班人员</th>\n        <th>星期一</th>\n        <th>星期二</th>\n        <th>星期三</th>\n    </tr>\n    <tr>\n        <td>李强</td>\n        <td>张明</td>\n        <td>王平</td>\n    </tr>\n</table>\n<h3 id="7-待办事宜-todo-列表"><a href="#7-%E5%BE%85%E5%8A%9E%E4%BA%8B%E5%AE%9C-todo-%E5%88%97%E8%A1%A8" aria-hidden="true"><span class="icon icon-link"></span></a>7. 待办事宜 Todo 列表</h3>\n<p>使用带有 [ ] 或 [x] （未完成或已完成）项的列表语法撰写一个待办事宜列表，并且支持子列表嵌套以及混用Markdown语法，例如：</p>\n<pre><code>- [ ] **Cmd Markdown 开发**\n    - [ ] 改进 Cmd 渲染算法，使用局部渲染技术提高渲染效率\n    - [ ] 支持以 PDF 格式导出文稿\n    - [x] 新增Todo列表功能 [语法参考](https://github.com/blog/1375-task-lists-in-gfm-issues-pulls-comments)\n    - [x] 改进 LaTex 功能\n        - [x] 修复 LaTex 公式渲染问题\n        - [x] 新增 LaTex 公式编号功能 [语法参考](http://docs.mathjax.org/en/latest/tex.html#tex-eq-numbers)\n- [ ] **七月旅行准备**\n    - [ ] 准备邮轮上需要携带的物品\n    - [ ] 浏览日本免税店的物品\n    - [x] 购买蓝宝石公主号七月一日的船票\n    \n</code></pre>\n<p>对应显示如下待办事宜 Todo 列表：</p>\n<ul>\n<li class="task-list-item">\n<p><input type="checkbox" disabled> <strong>Cmd Markdown 开发</strong></p>\n<ul>\n<li class="task-list-item"><input type="checkbox" disabled> 改进 Cmd 渲染算法，使用局部渲染技术提高渲染效率</li>\n<li class="task-list-item"><input type="checkbox" disabled> 支持以 PDF 格式导出文稿</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> 新增Todo列表功能 <a href="https://github.com/blog/1375-task-lists-in-gfm-issues-pulls-comments" target="_blank" rel="nofollow noopener noreferrer">语法参考</a></li>\n<li class="task-list-item">\n<p><input type="checkbox" checked disabled> 改进 LaTex 功能</p>\n<ul>\n<li class="task-list-item"><input type="checkbox" checked disabled> 修复 LaTex 公式渲染问题</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> 新增 LaTex 公式编号功能 <a href="http://docs.mathjax.org/en/latest/tex.html#tex-eq-numbers" target="_blank" rel="nofollow noopener noreferrer">语法参考</a></li>\n</ul>\n</li>\n</ul>\n</li>\n<li class="task-list-item">\n<p><input type="checkbox" disabled> <strong>七月旅行准备</strong></p>\n<ul>\n<li class="task-list-item"><input type="checkbox" disabled> 准备邮轮上需要携带的物品</li>\n<li class="task-list-item"><input type="checkbox" disabled> 浏览日本免税店的物品</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> 购买蓝宝石公主号七月一日的船票</li>\n</ul>\n</li>\n</ul>\n<p>[^footnote]: 这是一个 <em>注脚</em> 的 <strong>文本</strong>。</p>\n<p>[^footnote2]: 这是另一个 <em>注脚</em> 的 <strong>文本</strong>。</p>\n',image:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d7/Meisje_met_de_parel.jpg/600px-Meisje_met_de_parel.jpg",slug:"/demo3"}}}}}]);